import React from 'react'
import './styles/NavBar.css';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <header>
            <span className='logo_header_header'>House Staff</span>
            <ul className='nav_header_header'>
            <Link to='/' className='li'><li>Главная</li></Link>
            <Link to='/help' className='li'><li>Поддержка</li></Link>
            <Link to='/contacts' className='li'><li>Контакты</li></Link>
            <Link to='/cabinet' className='li'><li>Кабинет</li></Link>
            
            </ul>
            
            </header>
)}

export default NavBar
